import React from 'react';
import styles from './Header.module.css'

export default function Header() {
    return (
        <div className={styles.head}>
            <div className={styles.buttons}>
                <button>All</button>
                <button>Active</button>
                <button>Completed</button>
            </div>
        </div>
    );
}
